import React from "react";
import cry from "../Images/"

const cars = [
    {
      name: "Creta Hyundai",
      type: "SUV",
      discount: "16% Off!",
      price: "$210",
      oldPrice: "$250",
      rating: "4.7 ★",
      image: "https://via.placeholder.com/150",
    },
    {
      name: "Innova Crysta",
      type: "Economy",
      discount: "10% Off!",
      price: "$351",
      oldPrice: "$390",
      rating: "3.9 ★",
      image: "https://via.placeholder.com/150",
    },
    {
      name: "Toyota Etios",
      type: "Compact",
      discount: "20% Off!",
      price: "$192",
      oldPrice: "$240",
      rating: "4.5 ★",
      image: "https://via.placeholder.com/150",
    },
    {
      name: "Mahindra XUV500",
      type: "Economy",
      discount: "15% Off!",
      price: "$374",
      oldPrice: "$440",
      rating: "4.2 ★",
      image: "https://via.placeholder.com/150",
    },
  ];
  

const CarCard = ({ car }) => {
  return (
    <div className="flex flex-col md:flex-row bg-white shadow-lg rounded-xl p-4 mb-4">
      <img src={car.image} alt={car.name} className="w-full md:w-40 h-32 object-cover rounded-lg" />
      <div className="flex flex-col justify-between flex-1 p-4">
        <div className="flex items-center justify-between">
          <h2 className="text-lg font-semibold">{car.name}</h2>
          <span className="bg-blue-200 text-blue-600 text-xs px-2 py-1 rounded-md">{car.type}</span>
        </div>
        <div className="flex space-x-2 text-gray-500 text-sm mt-2">
          {car.features.map((feature, index) => (
            <span key={index} className="flex items-center">
              ✅ {feature}
            </span>
          ))}
        </div>
        <div className="flex items-center justify-between mt-2">
          <div className="flex items-center space-x-2">
            <span className="bg-green-100 text-green-600 text-xs px-2 py-1 rounded-md">{car.rating} ★</span>
            <span className="text-gray-500 text-xs">{car.category} ({car.reviews} reviews)</span>
          </div>
          <span className="text-green-500 font-semibold">{car.discount}</span>
        </div>
        <div className="flex items-center justify-between mt-4">
          <div>
            <span className="text-gray-400 text-sm line-through">{car.originalPrice}</span>
            <span className="text-lg font-semibold text-blue-600 ml-2">{car.discountedPrice}</span>
            <span className="text-gray-500 text-sm"> / per day</span>
          </div>
          <button className="bg-blue-500 text-white px-4 py-2 rounded-md hover:bg-blue-600">Book Now</button>
        </div>
      </div>
    </div>
  );
};

const FullcarsCard = () => {
  return (
    <div className="max-w-4xl mx-auto p-4">
      {cars.map((car, index) => (
        <CarCard key={index} car={car} />
      ))}
    </div>
  );
};

export default FullcarsCard;
